```javascript
const array = ['apple', 'Banana', 'cherry', 'date', 'Elderberry'];

array.sort((a, b) => {
  if (a < b) {
    return -1;
  }
  if (a > b) {
    return 1;
  }
  return 0;
});

console.log(array);
```

